{"nbformat":4,"nbformat_minor":0,"metadata":{"colab":{"provenance":[{"file_id":"1XVSc4yGbbQzlm_IiCRTHVHfdwG6fc8Mx","timestamp":1726575566378}],"mount_file_id":"1XVSc4yGbbQzlm_IiCRTHVHfdwG6fc8Mx","authorship_tag":"ABX9TyMYrvnQwCrK3BSSlXdbsB/N"},"kernelspec":{"name":"python3","display_name":"Python 3"},"language_info":{"name":"python"}},"cells":[{"cell_type":"markdown","source":["##Faturamento Realizado por Mês e RealizadoxOrçado\n","\n","\n"],"metadata":{"id":"nSdGOY0Gx7UX"}},{"cell_type":"code","source":["import streamlit as st\n","import pandas as pd\n","import matplotlib.pyplot as plt\n","import seaborn as sns\n","import matplotlib.ticker as ticker\n","\n","# Configuração para melhor visualização\n","plt.style.use('seaborn')\n","plt.rcParams['figure.figsize'] = (15, 7)\n","plt.rcParams['font.size'] = 12\n","\n","# Função para formatar os valores com ponto como separador decimal\n","def format_func(value, tick_number):\n","    return f'{value:,.0f}'.replace(',', '.')\n","\n","def plot_faturamento_realizado(df):\n","    fig, ax = plt.subplots(figsize=(15, 7))\n","    sns.barplot(x='Mês', y='Realizado', data=df[:-1], ax=ax)  # Excluindo a última linha (ACUMULADO)\n","    ax.set_title('Faturamento Realizado por Mês', fontsize=16)\n","    ax.set_xlabel('Mês')\n","    ax.set_ylabel('Faturamento Realizado (R$)')\n","    ax.set_xticklabels(ax.get_xticklabels(), rotation=45)\n","    ax.yaxis.set_major_formatter(ticker.FuncFormatter(format_func))\n","    for i, v in enumerate(df['Realizado'][:-1]):\n","        ax.text(i, v, f'{v:,.0f}'.replace(',', '.'), ha='center', va='bottom')\n","    plt.tight_layout()\n","    return fig\n","\n","def plot_faturamento_realizado_vs_orcado(df):\n","    fig, ax = plt.subplots(figsize=(15, 7))\n","    x = range(len(df['Mês'][:-1]))\n","    ax.plot(x, df['Realizado'][:-1], marker='o', label='Realizado')\n","    ax.plot(x, df['Orçado'][:-1], marker='s', label='Orçado')\n","    ax.set_title('Faturamento Realizado x Orçado por Mês', fontsize=16)\n","    ax.set_xlabel('Mês')\n","    ax.set_ylabel('Faturamento (R$)')\n","    ax.legend()\n","    ax.set_xticks(x)\n","    ax.set_xticklabels(df['Mês'][:-1], rotation=45)\n","    ax.yaxis.set_major_formatter(ticker.FuncFormatter(format_func))\n","    ax.grid(True, linestyle='--', alpha=0.7)\n","\n","    for i, (r, o) in enumerate(zip(df['Realizado'][:-1], df['Orçado'][:-1])):\n","        ax.text(i, r * 1.02, f'{r:,.0f}'.replace(',', '.'), ha='center', va='bottom', fontsize=8)\n","        ax.text(i, o * 0.98, f'{o:,.0f}'.replace(',', '.'), ha='center', va='top', fontsize=8)\n","\n","    plt.tight_layout()\n","    return fig\n","\n","def calcular_metricas(df):\n","    media_realizado = df['Realizado'][:-1].mean()\n","    total_realizado = df['Realizado'][:-1].sum()\n","    variacao_total = df['Variação'][:-1].sum()\n","    percentual_variacao = (variacao_total / df['Orçado'][:-1].sum()) * 100\n","\n","    return {\n","        \"Média mensal de faturamento realizado\": f\"R$ {media_realizado:,.2f}\".replace(',', '.'),\n","        \"Total de faturamento realizado\": f\"R$ {total_realizado:,.2f}\".replace(',', '.'),\n","        \"Variação total (Realizado - Orçado)\": f\"R$ {variacao_total:,.2f}\".replace(',', '.'),\n","        \"Percentual de variação\": f\"{percentual_variacao:.2f}%\".replace('.', ',')\n","    }\n","\n","# Carregar dados\n","@st.cache_data\n","def load_data():\n","    data = {\n","        'Mês': ['Jan 2023', 'Fev 2023', 'Mar 2023', 'Abr 2023', 'Mai 2023', 'Jun 2023',\n","                'Jul 2023', 'Ago 2023', 'Set 2023', 'Out 2023', 'Nov 2023', 'Dez 2023', 'ACUMULADO 2023'],\n","        'Orçado': [1871448.17, 1881305.31, 0.0, 2384933.31, 1892838.98, 2426768.57,\n","                   3365436.01, 2775783.80, 2939719.37, 4351472.10, 3158080.11, 3255719.92, 32451515.57],\n","        'Realizado': [2121320.90, 2612526.50, 1775687.17, 2631239.75, 2483240.08, 3061423.79,\n","                      2307138.54, 2429037.59, 2582752.71, 2157419.62, 2323382.35, 2699379.40, 29184548.40],\n","        'Variação': [249872.73, 731221.19, -372322.74, 246306.44, 590401.10, 634655.22,\n","                     -1058297.47, -346746.21, -356966.66, -2194052.48, -834697.76, -556340.52, -3266967.17],\n","        'Variação %': [13.4, 38.9, 0.0, 10.3, 31.2, 26.2,\n","                       -31.4, -12.5, -12.1, -50.4, -26.4, -17.1, -10.1]\n","    }\n","    return pd.DataFrame(data)\n","\n","# Aplicativo Streamlit\n","st.title('Dashboard de Faturamento')\n","\n","df_orcado_realizado = load_data()\n","\n","# Gráfico de Faturamento Realizado\n","st.subheader('Faturamento Realizado por Mês')\n","fig1 = plot_faturamento_realizado(df_orcado_realizado)\n","st.pyplot(fig1)\n","\n","# Gráfico de Faturamento Realizado x Orçado\n","st.subheader('Faturamento Realizado x Orçado por Mês')\n","fig2 = plot_faturamento_realizado_vs_orcado(df_orcado_realizado)\n","st.pyplot(fig2)\n","\n","# Métricas\n","st.subheader('Métricas de Faturamento')\n","metricas = calcular_metricas(df_orcado_realizado)\n","for chave, valor in metricas.items():\n","    st.metric(label=chave, value=valor)\n","\n","# Dados brutos\n","st.subheader('Dados Brutos')\n","st.dataframe(df_orcado_realizado)"],"metadata":{"id":"f5HwrcRn3hb5"},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":["##Saldo de caixa"],"metadata":{"id":"zVKQb7dvxd6g"}},{"cell_type":"code","source":["import pandas as pd\n","import matplotlib.pyplot as plt\n","\n","# Dados de Saldo de Caixa (Janeiro a Dezembro de 2023)\n","saldo_caixa = {\n","    'Mês': ['Jan', 'Fev', 'Mar', 'Abr', 'Mai', 'Jun', 'Jul', 'Ago', 'Set', 'Out', 'Nov', 'Dez'],\n","    'Ano': [2023] * 12,\n","    'Saldo': [\n","        1330570.62, 934686.68, 962080.73, 1042521.56, 1727837.58,\n","        2018840.63, 1933067.98, 1116155.23, 1108564.22, 2225567.45,\n","        1624441.35, 1707548.49\n","    ]\n","}\n","\n","# Converte os dados para DataFrame\n","df_saldo_caixa = pd.DataFrame(saldo_caixa)\n","\n","# Função para criar o gráfico de Saldo de Caixa\n","def plot_saldo_caixa(df):\n","    plt.figure(figsize=(10, 6))\n","\n","    # Converte os valores de saldo para milhões de R$\n","    df['Saldo (Milhões R$)'] = df['Saldo'] / 1e6\n","\n","    # Cria o gráfico de barras\n","    bars = plt.bar(df['Mês'], df['Saldo (Milhões R$)'], color='#ADD8E6')\n","\n","    # Adiciona linha lateral\n","    plt.grid(axis='y', color='#DCDCDC', linestyle='-')\n","\n","    # Adiciona título e rótulos\n","    plt.title('Saldo de Caixa (2023)')\n","    plt.xlabel('Mês')\n","    plt.ylabel('Saldo (Milhões R$)')\n","    plt.xticks(rotation=45)\n","\n","    # Adiciona os valores nas barras\n","    for bar in bars:\n","        height = bar.get_height()\n","        plt.text(bar.get_x() + bar.get_width() / 2, height, f'{height:.2f}',\n","                 ha='center', va='bottom', fontsize=10)\n","\n","    plt.tight_layout()\n","    st.pyplot()\n","\n","# Plota o gráfico de Saldo de Caixa\n","plot_saldo_caixa(df_saldo_caixa)"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":607},"id":"xOL_26ZzxGnG","executionInfo":{"status":"ok","timestamp":1726572977693,"user_tz":180,"elapsed":2816,"user":{"displayName":"Giovani Sgarabotto","userId":"00516321332261546120"}},"outputId":"73a54ae6-c561-42f9-fd8b-349f6c397cea"},"execution_count":null,"outputs":[{"output_type":"display_data","data":{"text/plain":["<Figure size 1000x600 with 1 Axes>"],"image/png":"\n"},"metadata":{}}]},{"cell_type":"markdown","source":["##Nível de Estoque"],"metadata":{"id":"adY6C9ZRxVth"}},{"cell_type":"code","source":["import pandas as pd\n","import matplotlib.pyplot as plt\n","\n","# Dados de Nível de Estoques Consolidado (Janeiro a Dezembro de 2023)\n","nivel_estoques = {\n","    'Mês': ['Jan', 'Fev', 'Mar', 'Abr', 'Mai', 'Jun', 'Jul', 'Ago', 'Set', 'Out', 'Nov', 'Dez'],\n","    'Ano': [2023] * 12,\n","    'Estoque (R$)': [\n","        641877, 688367, 694277, 708432, 720714, 747526, 768522, 779630, 793544, 903170, 884213, 880647\n","    ]\n","}\n","\n","# Converte os dados para DataFrame\n","df_nivel_estoques = pd.DataFrame(nivel_estoques)\n","\n","# Função para criar o gráfico de Nível de Estoques\n","def plot_nivel_estoques(df):\n","    plt.figure(figsize=(10, 6))\n","\n","    # Cria o gráfico de barras\n","    bars = plt.bar(df['Mês'], df['Estoque (R$)'], color='#90EE90')\n","\n","    # Adiciona linha lateral\n","    plt.grid(axis='y', color='#DCDCDC', linestyle='-')\n","\n","    # Adiciona título e rótulos\n","    plt.title('Nível de Estoques (2023)')\n","    plt.xlabel('Mês')\n","    plt.ylabel('Estoque (R$)')\n","    plt.xticks(rotation=45)\n","\n","    # Adiciona os valores nas barras\n","    for bar in bars:\n","        height = bar.get_height()\n","        plt.text(bar.get_x() + bar.get_width() / 2, height, f'{height:,.0f}'.replace(',', '.'),\n","                 ha='center', va='bottom', fontsize=10)\n","\n","    plt.tight_layout()\n","    st.pyplot()\n","\n","# Plota o gráfico de Nível de Estoques\n","plot_nivel_estoques(df_nivel_estoques)"],"metadata":{"colab":{"base_uri":"https://localhost:8080/","height":607},"id":"VJtPlDubxStw","executionInfo":{"status":"ok","timestamp":1726573002625,"user_tz":180,"elapsed":2479,"user":{"displayName":"Giovani Sgarabotto","userId":"00516321332261546120"}},"outputId":"147b63e7-9b87-490e-d90c-8bf3d1eef72e"},"execution_count":null,"outputs":[{"output_type":"display_data","data":{"text/plain":["<Figure size 1000x600 with 1 Axes>"],"image/png":"\n"},"metadata":{}}]}]}